import React, { Component } from "react";
import {Link} from "react-router-dom";
import "./accueil.css";

export default class Accueil extends Component{
    constructor(props){
        super(props);
        this.title = "Titre de la location"
    }

    render() {
        return (
        <div id="articles">
            <div id="article">
                <Link to="/coucou"><p id="article__title">{this.title}</p></Link>
            </div>
        </div>
        )
    }
}
